import React, { Component } from "react";
export default class City extends Component {
  constructor() {
    super();
    this.detals = {
      value: this.props.specificCity(),
    };
  }

  render() {
    console.log(this.match.params.cityName);
    return <h1>City</h1>;
  }
}
